/* eslint max-len:0 */

import React from 'react';

import { OperationStatus } from 'consts';

export default class Awaiter extends React.Component {
  render() {
    const { status } = this.props;

    if (status === OperationStatus.Pending) {
      return (
        <div style={{ margin: '20px auto', width: '35px', height: '35px' }}>
          <img
            width="35"
            height="35"
            alt=""
            src="data:image/gif;base64,"
          />
        </div>
      );
    }

    if (status === OperationStatus.Fail ||
      status === OperationStatus.CustomError) {
      return (
        <div className="error-box" style={{ margin: '20px auto', width: '200px' }}>
          <div className=" valign-middle-cell">
            Ошибка при загрузке
          </div>
        </div>
      );
    }

    return null;
  }
}
